import{_ as e,c as a,o as t,a as o}from"./app.ad4e2cff.js";const f=JSON.parse('{"title":"\u2600\uFE0F Welcome to Twake","description":"","frontmatter":{},"headers":[{"level":2,"title":"Use the canary version to try out new features","slug":"use-the-canary-version-to-try-out-new-features","link":"#use-the-canary-version-to-try-out-new-features","children":[]}],"relativePath":"index.md"}'),r={name:"index.md"},n=o('<h1 id="\u2600\uFE0F-welcome-to-twake" tabindex="-1">\u2600\uFE0F Welcome to Twake <a class="header-anchor" href="#\u2600\uFE0F-welcome-to-twake" aria-hidden="true">#</a></h1><p>Twake is an open source collaborative workspace. It can be self-hosted, used is saas and easily integrated into your teams. Twake offers all the features for collaboration : team chat, file storage, team calendar, tasks manager.</p><p>This <strong>documentation</strong> assists developers and users in having the best Twake experience as possible. We\u2019ve developed Twake to have a better teamwork.</p><hr><h1 id="\u{1F30E}-use-twake-on-twake-app" tabindex="-1">\u{1F30E} Use Twake on twake.app <a class="header-anchor" href="#\u{1F30E}-use-twake-on-twake-app" aria-hidden="true">#</a></h1><h4 id="start-using-twake-now" tabindex="-1">Start using Twake now <a class="header-anchor" href="#start-using-twake-now" aria-hidden="true">#</a></h4><p>To use Twake online it is simple, just go on <a href="https://twake.app" target="_blank" rel="noreferrer">twake.app</a> and click &quot;Sign up&quot;.</p><blockquote><p>Want to install it on your own server ? <a href="./onprem/installation.html">It is here</a>).</p></blockquote><h4 id="now-you-can-learn-how-to-become-a-twake-super-user" tabindex="-1">Now, you can learn how to become a Twake super-user <a class="header-anchor" href="#now-you-can-learn-how-to-become-a-twake-super-user" aria-hidden="true">#</a></h4><blockquote><p>Learn how to become a power user of Twake: <a href="./how-to-use-it/welcome.html">welcome.md</a></p></blockquote><blockquote><p>If you want to see the latest updates you can go here: <a href="https://github.com/linagora/Twake/blob/canary/changelog.md" target="_blank" rel="noreferrer">https://github.com/linagora/Twake/blob/main/changelog.md</a></p></blockquote><h2 id="use-the-canary-version-to-try-out-new-features" tabindex="-1">Use the canary version to try out new features <a class="header-anchor" href="#use-the-canary-version-to-try-out-new-features" aria-hidden="true">#</a></h2><p>You want to try the latest features from Twake before they come out to production? You can!</p><p>We have a server called Canary that will give you access to new features 1 month before their official releases. This server is compatible with the classic server so it means you can still discuss with your team even if you are the only one using the canary server.</p><p>The goal of the canary server it to do additional testing with a larger set of users, so if you encounter any issue, please notify us to help us fix the version before to ship it on production.</p><p>When using the canary server, the best is to set it up on all your devices like so:</p><h4 id="how-to-use-it-on-my-browser" tabindex="-1">How to use it on my browser <a class="header-anchor" href="#how-to-use-it-on-my-browser" aria-hidden="true">#</a></h4><p>Just go to <a href="https://canary.twake.app" target="_blank" rel="noreferrer">canary.twake.app</a> instead of web.twake.app.</p><h4 id="how-to-use-it-on-the-desktop-app" tabindex="-1">How to use it on the desktop app <a class="header-anchor" href="#how-to-use-it-on-the-desktop-app" aria-hidden="true">#</a></h4><p>Press Shift+Alt+Command or Shift+Ctrl+Alt to open the &quot;Change server url&quot; popup then enters <a href="https://canary.twake.app" target="_blank" rel="noreferrer">https://canary.twake.app</a> in the input then press OK.</p><h4 id="how-to-use-it-on-the-mobile-app" tabindex="-1">How to use it on the mobile app <a class="header-anchor" href="#how-to-use-it-on-the-mobile-app" aria-hidden="true">#</a></h4><p>Logout from the mobile app, click on Change server and put <a href="https://canary.twake.app" target="_blank" rel="noreferrer">https://canary.twake.app</a> then login.</p><blockquote><p>If you want to see the latest updates on the <strong>canary</strong> server you can go here: <a href="https://github.com/linagora/Twake/blob/canary/changelog.md" target="_blank" rel="noreferrer">https://github.com/linagora/Twake/blob/canary/changelog.md</a></p></blockquote>',23),s=[n];function h(i,p,l,u,c,d){return t(),a("div",null,s)}const k=e(r,[["render",h]]);export{f as __pageData,k as default};
